INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 1, 321, 0, 125801, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 1, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 2, 1, 322, 0, 126001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 1, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 3, 1, 323, 0, 126101, "んーと。\nこれ、あげる。\nはい", "プレシア", 1, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 4, 1, 324, 0, 125801, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 2, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 5, 1, 325, 0, 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 2, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 6, 1, 326, 0, 126101, "お兄。\nきてくれて、うれしい", "プレシア", 2, 2, 24001);
